[{'comment_id': 649839089, 'comment_body': 'Is there a use case in codebase where `maxNumberOfCharacters` has been passed as null ?(Apart from the tests)', 'comment_created': datetime.datetime(2021, 6, 11, 9, 38, 25, tzinfo=datetime.timezone.utc), 'commenter': 'mridul-netizen', 'type': 'User'}, {'comment_id': 650454265, 'comment_body': 'I could not find any usecase of this pipe inside the codebase, but having a None value for `maxNumberOfCharacters` makes sense. We can also refactor it and make `maxNumberOfCharacters` an optional parameter but a `CapitalizePipe` already exists for this purpose.', 'comment_created': datetime.datetime(2021, 6, 13, 1, 19, 9, tzinfo=datetime.timezone.utc), 'commenter': 'EeshaArif', 'type': 'User'}, {'comment_id': 650497783, 'comment_body': "This is used in `collection-summary-tile` , `exploration-summary-tile` and `information-card-modal` but with `maxNumberOfCharacters` as a parameter. I also think that this property can be null as mentioned in the test but making this optional would be better than making it null? I'm not sure if we make this ' | null ' then we have to use it like {{ .. | truncateAndCapitalize: null }} or just {{ .. | truncateAndCapitalize }} , can you confirm?", 'comment_created': datetime.datetime(2021, 6, 13, 9, 31, 4, tzinfo=datetime.timezone.utc), 'commenter': 'mridul-netizen', 'type': 'User'}, {'comment_id': 650640338, 'comment_body': 'I think making it optional brings a certain level of ambiguity with what the pipe is doing. When making it `| null`, we would have to specify an argument for the parameter since `null` is a value. So, we will have to use it like ` {{ .. | truncateAndCapitalize: null }} `. 

In any case, keeping the `null` value makes sense logically. wdyt?', 'comment_created': datetime.datetime(2021, 6, 14, 4, 18, 31, tzinfo=datetime.timezone.utc), 'commenter': 'EeshaArif', 'type': 'User'}, {'comment_id': 650685658, 'comment_body': ' One would prefer to use `CapitalizePipe` instead of this notation `{{ .. | truncateAndCapitalize: null }}` then , I think the respective test should be removed here and we should make this property mandatory? @vojtechjelinek wdyt about this?', 'comment_created': datetime.datetime(2021, 6, 14, 6, 49, 28, tzinfo=datetime.timezone.utc), 'commenter': 'mridul-netizen', 'type': 'User'}, {'comment_id': 650686223, 'comment_body': "`eslint-disable-next-line` why is this needed here? Also we're checking for input to exist in `if` condition so why would it be a empty string. Maybe check for not to be empty string as well?", 'comment_created': datetime.datetime(2021, 6, 14, 6, 50, 44, tzinfo=datetime.timezone.utc), 'commenter': 'mridul-netizen', 'type': 'User'}, {'comment_id': 650686485, 'comment_body': "Can we explain a bit more about `Pick` in a single or two line here? Since this might be the first place we're using this notation", 'comment_created': datetime.datetime(2021, 6, 14, 6, 51, 18, tzinfo=datetime.timezone.utc), 'commenter': 'mridul-netizen', 'type': 'User'}, {'comment_id': 652328330, 'comment_body': 'I do think it is pretty self explanatory and not needed. We were not explaining `Record<>` anywhere in the code either, since it is a built-in type for typescript.', 'comment_created': datetime.datetime(2021, 6, 16, 3, 47, 24, tzinfo=datetime.timezone.utc), 'commenter': 'EeshaArif', 'type': 'User'}, {'comment_id': 652331960, 'comment_body': '`eslint-disable-next-line` is needed for the following reason:
![Screenshot from 2021-06-16 08-57-49](https://user-images.githubusercontent.com/43031234/122155712-fbc41700-ce80-11eb-9069-ff497b6c8334.png)

and I am not sure by what you mean by why it would be an empty string? and checking for it to be an empty string?', 'comment_created': datetime.datetime(2021, 6, 16, 3, 59, 47, tzinfo=datetime.timezone.utc), 'commenter': 'EeshaArif', 'type': 'User'}, {'comment_id': 652452557, 'comment_body': "I mean why is this comment needed at all, it was not there before? Something like this should work: 
``` typescript
    if (!input && input === '') {
      return input;
    }
    let words = input.trim().match(/\S+/g);

    // Capitalize the first word and add it to the result.
    if (words === null) {
      throw new Error('No words found');
    }
    let result = words[0].charAt(0).toUpperCase() + words[0].slice(1);
```
I have added the condition where we check for it to be an empty string so if null or undefined return the same string and if empty then also return empty. You will have to add a test for error thrown.", 'comment_created': datetime.datetime(2021, 6, 16, 8, 8, 46, tzinfo=datetime.timezone.utc), 'commenter': 'mridul-netizen', 'type': 'User'}, {'comment_id': 652453712, 'comment_body': "I still think the particular test case should be removed, I'm approving to unblock my review!!", 'comment_created': datetime.datetime(2021, 6, 16, 8, 10, 17, tzinfo=datetime.timezone.utc), 'commenter': 'mridul-netizen', 'type': 'User'}, {'comment_id': 652639519, 'comment_body': 'Yeah, lets make it required.', 'comment_created': datetime.datetime(2021, 6, 16, 12, 28, 25, tzinfo=datetime.timezone.utc), 'commenter': 'vojtechjelinek', 'type': 'User'}, {'comment_id': 652643252, 'comment_body': 'Yeah, I would agree with @mridul-netizen approach.', 'comment_created': datetime.datetime(2021, 6, 16, 12, 33, 31, tzinfo=datetime.timezone.utc), 'commenter': 'vojtechjelinek', 'type': 'User'}, {'comment_id': 652643715, 'comment_body': '```suggestion
  // Check https://www.typescriptlang.org/docs/handbook/utility-types.html#picktype-keys
```', 'comment_created': datetime.datetime(2021, 6, 16, 12, 34, 10, tzinfo=datetime.timezone.utc), 'commenter': 'vojtechjelinek', 'type': 'User'}, {'comment_id': 653641194, 'comment_body': "The `eslint-disable-next-line` was needed because I used a `(!) non-null assertion`  for the line
```typescript
let words = input.trim().match(/\S+/g)!;
```

The comment was needed to explain why `words` can never be `null`. `match()` for this particular regexp will only return `null` on an empty string. Now, since `!input` will be also be `true` for when `input == ''` and this condition was already being checked before the statement where `match()` was called, `words` will simply just never be `null`.

Taking a look at @mridul-netizen approach, the following condition can **never** happen: We cannot even write tests for it. It is unreachable.
```typescript
if (words === null) {
      throw new Error('No words found');
    }
```", 'comment_created': datetime.datetime(2021, 6, 17, 14, 51, 18, tzinfo=datetime.timezone.utc), 'commenter': 'EeshaArif', 'type': 'User'}, {'comment_id': 653663932, 'comment_body': "```suggestion
    Pick<Location, 'href' | 'origin' | 'pathname' | 'hash' | 'search'>;
```", 'comment_created': datetime.datetime(2021, 6, 17, 15, 16, 6, tzinfo=datetime.timezone.utc), 'commenter': 'vojtechjelinek', 'type': 'User'}, {'comment_id': 653669875, 'comment_body': "```suggestion
    // The following regexp match will only return 'null' on an empty input
    // string, the empty string condition is already being checked above. 
    // Non-null assertion is used to make the TypeScript typing happy.
```", 'comment_created': datetime.datetime(2021, 6, 17, 15, 21, 59, tzinfo=datetime.timezone.utc), 'commenter': 'vojtechjelinek', 'type': 'User'}]

