', 'comment_created': datetime.datetime(2021, 8, 10, 19, 57, 12, tzinfo=datetime.timezone.utc), 'commenter': 'EeshaArif', 'type': 'User'}, {'comment_id': 686856493, 'comment_body': 'Why is this changed? I think `toBeNull` is prefered.', 'comment_created': datetime.datetime(2021, 8, 11, 13, 56, 11, tzinfo=datetime.timezone.utc), 'commenter': 'vojtechjelinek', 'type': 'User'}, {'comment_id': 686857485, 'comment_body': 'Why is this changed? I think `toBeNull` is prefered.', 'comment_created': datetime.datetime(2021, 8, 11, 13, 57, 9, tzinfo=datetime.timezone.utc), 'commenter': 'vojtechjelinek', 'type': 'User'}, {'comment_id': 687030372, 'comment_body': "Hmm, okay, but I don't see the reason why this needs to be done in TS, why this cannot be handled just by CSS? Is there any case where the titles actually differ between mobile and non-mobily (except for the case where it is not shown)?", 'comment_created': datetime.datetime(2021, 8, 11, 17, 23, 2, tzinfo=datetime.timezone.utc), 'commenter': 'vojtechjelinek', 'type': 'User'}, {'comment_id': 687111190, 'comment_body': 'intersection  union', 'comment_created': datetime.datetime(2021, 8, 11, 19, 24, 34, tzinfo=datetime.timezone.utc), 'commenter': 'vojtechjelinek', 'type': 'User'}, {'comment_id': 687112974, 'comment_body': "The link is not working for me (it doesn't show the specific location) could you tell me the name of the file you're pointing to?", 'comment_created': datetime.datetime(2021, 8, 11, 19, 27, 25, tzinfo=datetime.timezone.utc), 'commenter': 'vojtechjelinek', 'type': 'User'}, {'comment_id': 687119776, 'comment_body': 'Yes, this type is **not** a union of those two interfaces. union implies that it could be either `EmailPreferencesBackendDict` or `NonEmailPreferencesBackendDict`. But in our case, the type has to include the properties of **both** the interfaces and not just one and thats why an intersection was used.
https://www.typescriptlang.org/docs/handbook/unions-and-intersections.html#intersection-types ', 'comment_created': datetime.datetime(2021, 8, 11, 19, 38, 24, tzinfo=datetime.timezone.utc), 'commenter': 'EeshaArif', 'type': 'User'}, {'comment_id': 687121454, 'comment_body': "yes, it is the same file `extensions/objects/templates/subtitled-unicode-editor.component.ts`. I was pointing to it's `updateValue` method

https://github.com/oppia/oppia/blob/37c24c46e6fc5a9ee1e8df6fb62d55737fa1ced3/extensions/objects/templates/subtitled-unicode-editor.component.ts#L34-L39", 'comment_created': datetime.datetime(2021, 8, 11, 19, 41, 14, tzinfo=datetime.timezone.utc), 'commenter': 'EeshaArif', 'type': 'User'}, {'comment_id': 687759414, 'comment_body': 'I did check and I could not find any place where the titles differ like you said. @mridul-netizen used non-null assertion [here](https://github.com/oppia/oppia/commit/5daa0b1bbcb4146065f99222a88217d212ed02d1) and the PR has been merged. The titles are set using the angular lifecycle hooks though.', 'comment_created': datetime.datetime(2021, 8, 12, 14, 20, 23, tzinfo=datetime.timezone.utc), 'commenter': 'EeshaArif', 'type': 'User'}, {'comment_id': 687763825, 'comment_body': 'ah a mistake, updated', 'comment_created': datetime.datetime(2021, 8, 12, 14, 25, 21, tzinfo=datetime.timezone.utc), 'commenter': 'EeshaArif', 'type': 'User'}, {'comment_id': 687764042, 'comment_body': 'updated', 'comment_created': datetime.datetime(2021, 8, 12, 14, 25, 36, tzinfo=datetime.timezone.utc), 'commenter': 'EeshaArif', 'type': 'User'}, {'comment_id': 687844780, 'comment_body': 'Ohhh, can we add the link to the comment and maybe an explanation that this is not set intersection? The naming that TS uses is a bit confusing (at least for me) because in set theory union and intersection have a slightly different meaning than here. When I see union or intersection mentioned I will immediately think of sets and try to use understand it by that.', 'comment_created': datetime.datetime(2021, 8, 12, 15, 30, 11, tzinfo=datetime.timezone.utc), 'commenter': 'vojtechjelinek', 'type': 'User'}, {'comment_id': 687846730, 'comment_body': 'Okay, I see.', 'comment_created': datetime.datetime(2021, 8, 12, 15, 31, 42, tzinfo=datetime.timezone.utc), 'commenter': 'vojtechjelinek', 'type': 'User'}, {'comment_id': 687908470, 'comment_body': 'yes, the set theory does imply a different meaning. updated comment!', 'comment_created': datetime.datetime(2021, 8, 12, 16, 36, 31, tzinfo=datetime.timezone.utc), 'commenter': 'EeshaArif', 'type': 'User'}, {'comment_id': 688842173, 'comment_body': '```suggestion
// Note: Intersection in TypeScript is used differently than in set theory,
// the latter implies that the type will include only the properties that are
// are the same in both the interfaces whereas the former includes all the
// properties from both the interfaces. For more information, check
// https://www.typescriptlang.org/docs/handbook/unions-and-intersections.html#intersection-types
```', 'comment_created': datetime.datetime(2021, 8, 14, 1, 10, 34, tzinfo=datetime.timezone.utc), 'commenter': 'vojtechjelinek', 'type': 'User'}, {'comment_id': 688842973, 'comment_body': "Not sure to which exact file you're referring to in the linked commit.

